import '../styles/global.css';

const CreateDiaryPage: React.FC = () => {
  return (
    <div className="container" style={{
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'flex-start',
      alignItems: 'center',
      minHeight: '100vh',
      width: '100%',
      background: '#1a1a1a',
      color: 'white',
    }}>
      <h1 style={{
        fontSize: '3.5rem',
        fontWeight: 'bold',
        marginTop: '2rem',
        marginBottom: '2rem',
