        color: '#ff69b4',
        textShadow: `
          0 0 7px #ff69b4,
          0 0 10px #ff69b4,
          0 0 21px #ff69b4,
          0 0 30px #ff1493,
          0 0 50px #ff1493
        `,
      }}>
        Story Dashboard
      </h1>
      <div style={{
        textAlign: 'center',
        maxWidth: '800px',
        padding: '2rem',
      }}>
        {/* Content will be added here */}
      </div>
    </div>
  );
};

export default CreateDiaryPage;
